<script src="https://ajax.googleapis.com/ajax/libs/jquery/3.4.1/jquery.min.js"></script>
<script>

in_points = [];
out_point_diffs = [];
warp_bound = [];
function warpme(){
	

	// http://jsfiddle.net/uk4c2jqr/2/
	$("#svg-element").remove();
	var tb_head = $('#figure_1').clone();
	var svg_fake = $('#svg-fake').clone();
	$(svg_fake).attr("id","svg-element");
	$(svg_fake).attr("style","display:block;");
	$("#svg-holder").append(svg_fake);
	$('#svg-element').append(tb_head);
		
		
	var svg = document.getElementById('svg-element');
	// https://github.com/benjamminf/warpjs
	var warp = new Warp(svg);

	
	function d ([x, y]){
		let dx = 0;
		let dy = 0;
		let den = 0;

		// https://franciscohodge.com/2018/01/14/find-closest-element-click-coordinates-javascript-coding-question/
		in_points.forEach(function (linkCoord,i) {
			let distance = Math.hypot(linkCoord[0]-x, linkCoord[1]-y);
			if (distance < warp_bound[i]){
				dx = dx + (1-distance/warp_bound[i])*out_point_diffs[i][0];
				dy = dy + (1-distance/warp_bound[i])*out_point_diffs[i][1];
				den = den + 1;
			}
		});
		if (den==0){
			return [x,y];
		}
		return [x+dx/den,y+dy/den];

	}

	warp.interpolate(4);
	warp.transform(d);
	
}
warpme();

function clicked(evt){
    // https://www.sitepoint.com/how-to-translate-from-dom-to-svg-coordinates-and-back-again/
    var e = evt.target;
    var urg = document.getElementById('svg-element')
	var pt = urg.createSVGPoint();
	pt.x = evt.clientX;
	pt.y = evt.clientY;
	var svgP = pt.matrixTransform(urg.getScreenCTM().inverse());
	
	in_points.push([svgP.x,svgP.y]);
	out_point_diffs.push([10,10]);
	warp_bound.push(50);
	warpme();
}  
</script>
